import Header from './Header';
import Main from './Main';
import Footer from './Footer';

function App() {
  return (
    <div>
    <Header />
    <Main />
    <Footer />
    <div className="image-popup popup popup_type_image">
      <div className="image-popup__container">
        <button className="popup__close-button popup__close-button_type_image" type="button" aria-label="Закрыть" />
        <img src="/" alt="this-pic" className="image-popup__image" />
        <h2 className="image-popup__title" />
      </div>
    </div>
    <div className="popup popup_type_error">
      <div className="popup__container popup__container_type_error">
        <h2 className="popup__heading popup__heading_type_error">Ошибка =(</h2>
        <p className="popup__error-message" />
        <button className="popup__close-button" type="button" aria-label="Закрыть" />
      </div>
    </div>
    <template className="template" />
  </div>
  );
}

export default App;
